  //   let diners = new RegExp("^3[0689][0-9]{12}[0-9]*$");
  //   let jcb = new RegExp("^35[0-9]{14}[0-9]*$");

  if (cc === "visa") {
    return "visa";
  }
  if (cc === "amex") {
    return "amex";
  }
  if (cc == "maestro") {
    return "maestro";
  }
  if (cc === "mastercard") {
    return "mastercard";
  }
  if (cc === "discover") {
    return "discover";
  }
  if (cc == "diners") {
    return "diners";
  }
  if (cc === "jcb") {
    return "JCB";
  }
